//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;

/** 
 * @title Database
 * @dev Save Professor
 */

contract Database {
    // 출석 내용을 저장하는 enum 타입 (0=success, 1=fail)
    //enum Reservation_state { Success, Fail }

    struct Student_DB{
        string student_name;
        address student;
    }

    struct Bus_DB{
        address bus;
        string destination;
        uint start_time;
        uint[45] Seat_number;
    }


   //관리자
    address private manager;
  //버스 명단
    address[] private buses;
   //학생들 명단
    address[] private students;
    address[] private owner;
   //버스 번호
    string[] private busNum;
   //학생 학번
    uint[] private studentNum;

    mapping(string => Bus_DB) BusDB; 
    mapping(uint => Student_DB) StudentDB;
    // mapping(uint => bus_seat) BusSeat;

    // constructor(address[] memory _owner){
    //     owner = _owner;
    // }

    function addStudent(string memory student_name, uint studentNum) public {
       StudentDB[studentNum] = Student_DB(student_name, msg.sender); // 학생을 추가한 사람의 주소
    }

    function addBus(address bus, string memory destination, uint start_time, string memory busNum) public {
      uint[45] memory seat;

      BusDB[busNum] = Bus_DB(bus, destination, start_time, seat);
    }

    function deleteStudent(uint _num) public returns(string memory){
        require(bytes(StudentDB[_num].student_name).length != 0, "There is no student");

        delete StudentDB[_num];

        return "Delete succece";
    }

    function getStudents(uint _num) public view returns(string memory, address){ //이게 왜 되지?
        string memory name;
        address student_add;

        name = StudentDB[_num].student_name;
        student_add = StudentDB[_num].student;

        return (name,student_add);
    }
}

